import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Container from "./components/Container/Container";
import Menu from "./components/Menu/Menu";

function App() {
  return (
    <BrowserRouter>
      <Container>
        <Routes>
          <Route path="/" element={Menu}></Route>
        </Routes>
      </Container>
    </BrowserRouter>
  );
}

export default App;
